window.bookSummaryJSON = "<p><b>Danger and desire...for one Interstellar Bride, they prove an irresistible mix.</b></p> <p>Whitney Mason is the daughter of a Wall Street con man. When he is sent to prison and her family’s name is destroyed, she is eager for a new life on a new world. Anywhere but Earth. Tested by the Interstellar Brides Program, she is matched to a strong Viken warrior. What she doesn’t know is that her mate and the other two warriors waiting to claim her are on a secret and dangerous mission for the Coalition Fleet’s Intelligence Core. From the moment she arrives on Viken, they are forced to lie to her...about everything...except their desire.</p> <p>For Alarr, Oran, and Teig, the arrival of a bride is an unexpected complication. The timing couldn’t be worse, but IC command is thrilled. A bride is the perfect cover, giving the fighters access to every inch of the famous pleasure resort where they are working undercover. The males are eager to satisfy their new mate, but keeping her safe is their top priority, even if that means lying to her and using her pleasure to take down the enemy. But their sexy mate’s past will come back to haunt them all, for even if they survive the mission, the truth will be revealed and their beautiful, curvy female can forgive anything - except lies.</p>"; 
